INSERT INTO `cms_page` VALUES ('28','董事长致辞','','','','<img src=\"/Public/Image/in_2027.jpg\" align=\"right\" /> \r\n<p>\r\n	&nbsp; &nbsp;近二十年来，我们风雨兼程，携手共进，共创了事业的辉煌。这里有我们公司全体员工的积极努力，不断开拓，也有广大新老客户的信赖与支持，共同奠定了“黑豹”品牌的坚实基础。<img src=\"/Public/Image/bg_1001.gif\" width=\"1\" height=\"10\" />&nbsp; &nbsp;今天的“黑豹”不仅仅代表一种品牌，而是一种品牌的延伸，更是一种精神。“诚信守道，敬业爱业”是我们的理念。在过去的岁月里，是我们一直秉承的规则与信念。如今，我们的业务网络已遍布全国各地，以优质的服务，赢得各方好评，更是以“旧”带“新”，成就了我们日益壮大的客户群，这一切源于我们公司在建筑防水行业的突出地位。<img src=\"/Public/Image/bg_1001.gif\" width=\"1\" height=\"10\" />&nbsp; &nbsp;我们公司是一家与国内重点高等院校的专家教授和科研院所专家教授长期合作，集聚合物水泥防水材料科研开发，生产销售、工程承包、技术咨询为一体的专业防水公司，是国内早期研制和生产聚合物水泥防水材料的生产企业。在过去的岁月里，HB聚合物水泥防水砂浆改性剂和HB聚合物水泥防水涂料及科研成果曾多次获奖。“黑豹”商标2010年荣获广东省著名商标。<img src=\"/Public/Image/bg_1001.gif\" width=\"1\" height=\"10\" />&nbsp; &nbsp;\r\n</p>\r\n<p>\r\n	<span>&nbsp; &nbsp;</span>衷心感谢各界朋友的支持和厚爱，期待着各界朋友对我们的事业继续予以关心、信任和支持，并望提出宝贵意见。<img src=\"/Public/Image/bg_1001.gif\" width=\"1\" height=\"10\" />&nbsp; &nbsp;\r\n</p>\r\n<p>\r\n	&nbsp; 董事长：王荣柱\r\n</p>','','0','1');
INSERT INTO `cms_page` VALUES ('29','公司简介','','','','<img src=\"/Public/Image/in_2026.jpg\" width=\"260\" height=\"320\" align=\"right\" alt=\"\" /> \r\n<p>\r\n	&nbsp; &nbsp; 深圳市新黑豹建材有限公司近二十年来，我们风雨兼程，携手共进，共创了事业的辉煌。这里有我们公司全体员工的积极努力，不断开拓，也有广大新老客户的信赖与支持，共同奠定了“黑豹”品牌的坚实基础。今天的“黑豹”不仅仅代表一种品牌，及品牌的延伸，更是一种精神。它是我们全体黑豹人智慧及实干的结晶。<img src=\"/Public/Image/bg_1001.gif\" width=\"1\" height=\"10\" />&nbsp;\r\n</p>\r\n<p>\r\n	<span>&nbsp; &nbsp;&nbsp;</span><span></span>“诚信守道，敬业爱业”是我们的理念，是我们一直秉承的规则与信念。如今，我们的业务网络已遍布全国各地：内蒙、重庆、海南、广东、广西、湖北、江西、四川、山西、湖南、天津、山东、江苏等地，都有我们的客户；以优质的服务，赢得各方好评，以“旧”带“新”，成就了我们日益壮大的客户群，这一切源于我们公司在建筑防水行业的突出地位。<img src=\"/Public/Image/bg_1001.gif\" width=\"1\" height=\"10\" />&nbsp; &nbsp; 我们公司是一家与国内重点院校专家教授和科研院所专家教授长期合作，以中国材料科工集团苏州非矿院防水设计研究所专家教授为技术依托，集防水材料科研、开发、生产销售、工程承包、技术咨询为一体的专业防水公司，是国内早期研制和生产聚合物水泥防水材料的生产企业。公司技术力量雄厚、生产管理规范、配方独特、工艺先进、常规检测设备齐全。<img src=\"/Public/Image/bg_1001.gif\" width=\"1\" height=\"10\" /><span></span>&nbsp; HB黑豹牌聚合物水泥防水涂料、HB聚合物水泥防水砂浆、HB水泥基渗透结晶型防水材料分别通过省、市级科技成果鉴定并获奖。公司参与编制了国家标准GB/T23445-2009《聚合物水泥防水涂料》、GB/T23440-2009《无机防水堵漏材料》、国家行业标准JC/T984-2011《聚合物水泥防水砂浆》、JC/T2090-2011《聚合物水泥防水浆料》以及 HJ457-2009《环境标志产品技术要求防水涂料》。近年来，公司更是不断完善和提高产品质量，全面推行ISO9001.2000质量管理体系和ISO14001环境管理体系。在年生产5000吨“黑豹”HB聚合物水泥防水涂料、防水砂浆系列产品的基础上，控股公司宜昌市黑豹建筑防水材料有限公司部分引进国外先进生产设备，新增年产4000吨的聚合物干粉系统和年产5000吨的水泥基渗透结晶型防水材料生产线。经国家权威部门检测及实际工程应用，其技术性能达到国内领先水平。\r\n</p>\r\n<p>\r\n	<img src=\"/Public/Image/bg_1001.gif\" width=\"1\" height=\"10\" />&nbsp; &nbsp; 我们的产品质量过硬、众口称誉，我们的队伍踏实肯干、经验丰富，良好的社会效益是我们永远的追求。<img src=\"/Public/Image/bg_1001.gif\" width=\"1\" height=\"10\" /> \r\n</p>\r\n<p>\r\n	&nbsp; &nbsp; 面对辉煌，我们会更加不懈地努力，立志树立业内一流的品牌，以今天的锲而不舍为明天的荣耀再添砝码！\r\n</p>','','0','1');
