\"MsoNormal\">\r\n										<span><span><span>a</span></span><span style=\"font-family:宋体;\">凝结时间项目可根据用户需要及季度变化进行调整</span><span></span></span> \r\n									</p>\r\n								</td>\r\n							</tr>\r\n						</tbody>\r\n					</table>\r\n					<p>\r\n						<br />\r\n					</p>\r\n					<p>\r\n						<strong>四、使用方法</strong>&nbsp;<br />\r\n&nbsp;&nbsp;&nbsp;1. 基层处理:&nbsp;基体表面应平整结实,无蜂窝、麻面，无粉尘和油污现象。基面上的裂缝、空洞需事先用本产品修补好。&nbsp;<br />\r\n&nbsp;&nbsp; 2.&nbsp;施工前基面要充分润湿，但不应有明水。&nbsp;<br />\r\n&nbsp;&nbsp; 3.&nbsp;配制防水砂浆，按JF-II胶液：水：水泥：砂=1：1：4：8（重量比），并拌合均匀。&nbsp;<br />\r\n&nbsp;&nbsp; 4.&nbsp;施工，将拌和好的聚合物防水砂浆进行批档，待涂层表干后（表面手压不粘手），时间约2-3h,可再刮涂一遍， 并压实抹光，厚度达到防水设计要求。在最后一遍刮涂完成后进行48h湿养护。&nbsp;<br />\r\n&nbsp;&nbsp; 5.&nbsp;用量：1.0~1.2㎏/㎡&nbsp;&nbsp;\r\n					</p>\r\n					<p>\r\n						<strong>五、注意事项&nbsp;<br />\r\n</strong>&nbsp;&nbsp;&nbsp;1. 水泥为P.042.5级及以上普通硅酸盐水泥，砂为中砂或细砂。&nbsp;<br />\r\n&nbsp;&nbsp; 2.&nbsp;施工温度应在5℃以上，雨天和0℃以下不宜施工。&nbsp;<br />\r\n&nbsp;&nbsp; 3.&nbsp;本产品应贮存在阴凉处，保存期6个月。\r\n					</p>\r\n				</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n</p>\r\n<p>\r\n	<strong><br />\r\n</strong>\r\n</p>','0','/Public/Image/2011122163136999.jpg','0','1','0','','0','0','312','1479213902','1479214435','0.00','/jianzhuyongjiao/show/8.html','','','1','','工业与民用建筑工程用防水、防渗漏、防潮等','深圳市新黑豹建材有限公司');
